&lt;p class=&quot;Texto_Centralizado_Maiusculas_Negrito&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/p&gt;
&lt;p class=&quot;Texto_Centralizado_Maiusculas_Negrito&quot;&gt;ORGAO ABC&lt;/p&gt;
&lt;p class=&quot;Texto_Centralizado_Maiusculas_Negrito&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;Texto_Centralizado_Maiusculas&quot;&gt;Abertura de Procedimento Licitat&amp;oacute;rio n&amp;ordm; 1/2019&lt;/p&gt;
&lt;p class=&quot;Texto_Justificado_Recuo_Primeira_Linha&quot;&gt;&lt;b&gt;O [DIGITE AQUI O NOME DO CARGO] DA ORGAO ABC&lt;/b&gt;, no uso das atribui&amp;ccedil;&amp;otilde;es que lhe foram conferidas pelo art. [DIGITE AQUI O DISPOSITIVO] do&amp;nbsp;[DIGITE AQUI A LEGISLA&amp;Ccedil;&amp;Atilde;O APLICADA], aprovado(a) pela [INDIQUE AQUI A NORMA, SEU N&amp;Uacute;MERO E DATA], e&lt;/p&gt;

&lt;p class=&quot;Texto_Justificado_Recuo_Primeira_Linha&quot;&gt;CONSIDERANDO o &lt;a href=&quot;http://www.planalto.gov.br/ccivil_03/_ato2004-2006/2005/decreto/d5450.htm&quot; target=&quot;_blank&quot;&gt;Decreto n&amp;ordm; 5.450, de 31 de maio de 2005&lt;/a&gt;, que regulamenta o preg&amp;atilde;o, na forma eletr&amp;ocirc;nica, para aquisi&amp;ccedil;&amp;atilde;o de bens e servi&amp;ccedil;os comuns, e d&amp;aacute; outras provid&amp;ecirc;ncias;&lt;/p&gt;

&lt;p class=&quot;Texto_Justificado_Recuo_Primeira_Linha&quot;&gt;CONSIDERANDO a &lt;a href=&quot;http://www.planalto.gov.br/ccivil_03/Leis/L8666compilado.htm&quot; target=&quot;_blank&quot;&gt;Lei n&amp;ordm; 8.666, de 21 de junho de 1993&lt;/a&gt;, que regulamenta o art. 37, inciso XXI, da Constitui&amp;ccedil;&amp;atilde;o Federal, institui normas para licita&amp;ccedil;&amp;otilde;es e contratos da Administra&amp;ccedil;&amp;atilde;o P&amp;uacute;blica,&amp;nbsp; e d&amp;aacute; outras provid&amp;ecirc;ncias;&lt;/p&gt;

&lt;p class=&quot;Texto_Justificado_Recuo_Primeira_Linha&quot;&gt;CONSIDERANDO o constante dos autos do processo n&amp;ordm; 99990.000001/2019-24,&lt;/p&gt;

&lt;p class=&quot;Texto_Espaco_Duplo_Recuo_Primeira_Linha&quot;&gt;DECIDE:&lt;/p&gt;

&lt;p class=&quot;Paragrafo_Numerado_Nivel1&quot; style=&quot;margin-left: 120px;&quot;&gt;Determinar a abertura do procedimento licitat&amp;oacute;rio, autorizando a sua realiza&amp;ccedil;&amp;atilde;o, na modalidade Preg&amp;atilde;o, na forma eletr&amp;ocirc;nica, tipo menor pre&amp;ccedil;o, com fulcro no art. 8&amp;ordm;, inciso III, do Decreto n&amp;ordm; 5.450/2005 c/c art. 38, da Lei n&amp;ordm; 8.666/1993, visando &amp;agrave; contrata&amp;ccedil;&amp;atilde;o de &lt;span style=&quot;color:#0000FF;&quot;&gt;[digite aqui a descri&amp;ccedil;&amp;atilde;o do objeto da contrata&amp;ccedil;&amp;atilde;o]&lt;/span&gt;, caracterizado como servi&amp;ccedil;o comum, nos moldes do art. 4&amp;ordm; do Decreto n&amp;ordm; 5.450/2005.&lt;/p&gt;

&lt;p class=&quot;Paragrafo_Numerado_Nivel1&quot; style=&quot;margin-left: 120px;&quot;&gt;Este documento&amp;nbsp;entra em vigor na data de sua publica&amp;ccedil;&amp;atilde;o.&lt;/p&gt;

